  \"valley-city-wetland-management-district-annual-narrative-report-calendar-year-1979\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valley City Wetland
  Management District during the 1979 calendar year. The report begins by giving a
  brief introduction to the district, as well as the climatic and habitat conditions,
  land acquisition program, and system status during the year. The construction and
  maintenance section discusses construction, maintenance, and wildfires. Habitat
  management is discussed; topics include croplands, grasslands, wetlands, and easements
  for waterfowl production. Wildlife- including migratory birds and big game animals-
  is also covered. The interpretation and recreation section discusses information
  and interpretation, recreation, and enforcement. A progress report on field investigations
  and applied research is also provided. Cooperative programs, items of interest,
  and safety are discussed. Brief narratives on Tomahawk, Stoney Slough, Sibley Lake,
  and Hobart Lake National Wildlife Refuges are included. Photographs are attached.\",\n\t\"license_title\":
